import React, { Component } from 'react';

class Main extends React.Component {
    render() {
        return (
            <React.Fragment>
                <NavBar />
                <Intro />
                <About />
                <Skills />
                <Projects />
                <Footer />
            </React.Fragment>
        )
    }
}

export default Main;
